import { InjectionToken } from '@angular/core';
import { Observable } from 'rxjs';
import { PhotoDTO } from './photo.dto';

export const GET_ONE_PHOTO_DTO_PORT = new InjectionToken<GetOnePhotoDtoPort>(
  'GET_ONE_PHOTO_DTO_PORT'
);

export interface GetOnePhotoDtoPort {
  getOnePhoto(id: number): Observable<PhotoDTO>;
}
